Eclectic Texas-based singer/songwriter Jana Hunter signed to Devendra Banhart and Vetiver frontman Andy Cabic's Gnomonsong label in 2005 for her debut, Blank Unstaring Heirs of Doom. The Houston native, who has also spent time in the popular southwestern group Matty &amp; Mossy, and more recently Jracula, released her second collection of songs, There's No Home, in April 2007. 

